import React, { Component } from 'react';


class NavBar extends Component{

    render(){
        return (
            <div className="NavBar">
                <nav className="navbar navbar-dark bg-dark">
                <a class="navbar-brand" href="#">Navbar</a>
                </nav>

            </div>   
        )
    }
}

export default NavBar;
